import React from 'react';
import Dropdown from './Dropdown';

function List() {
    return (
        <ul className="navbar-nav mr-auto">
            <Dropdown/>
            <li className="nav-item">
                <a className="nav-link" href="#"><h4 className="colour">Home</h4></a>
            </li>
            <li className="nav-item">
                <a className="nav-link disabled" href="#"><h4 className="colour">Home</h4></a>
            </li>
        </ul>
    )
}
export default List;
